ハローキティのかわいいドライブレコーダーです。<br>●万が一の事故に遭遇した場合、事故時の走行映像を記録します。また、ドライブの思い出にシーンを録画したり、シーンを見て楽しんだりとカーライフを満喫するアイテムです。<br>● エンジンONで自動で録画を開始し、エンジンOFFで録画を停止するため、スイッチのON/OFFがいらなく、電子機器が苦手な方でも簡単にご使用いただけます。<br>● microSDに連続録画され、容量がいっぱいになると自動で上書き保存を行います。※1<br>● 衝撃や振動を感知すると緊急事態と判断して自動的に動画ファイルを保護して上書きを防止する【Gセンサー（重力センサー）】搭載です。<br>● 車のエンジンを停止した停車中や駐車時でも衝撃を感知して自動的に録画が開始する【駐車監視機能（ストップモード）】搭載で車を離れた際の不測の事態にも対処します。<br>● 万一の事故の際は（静止録画モード）でデジカメとしての撮影も可能です。事故現場での証拠撮影にも。<br>● 粘着テープにてフロントウィンドウに簡単取り付け。<br>● microSDカード8GB付属。DC12/24V対応。<style type="text/css">
